import React, { Component } from 'react'

class DateComponent extends Component {
    constructor() {
        super();

        var today = new Date(),
            date = today.getDate(),
            month = today.getMonth()+1,
            year = today.getFullYear();

        this.state = {
            date: date,
            month: month,
            year: year
        };
    }



    render() {
        return (
            <div>
                {this.state.date}
            </div>
        )
    }
}

export default DateComponent
